import './App.scss';
import RegistrationPage from "./Pages/Registration/Registration";
import Entrance from "./Pages/Entrance/Entrance";
import {Route, BrowserRouter} from "react-router-dom";

function App() {
    return (
        <BrowserRouter>
            <div>
               <Route>
                   <RegistrationPage/>
                   <Entrance/>
               </Route>
            </div>
        </BrowserRouter>
    );
}

export default App;
